import React from 'react'


const attributes = {
    strength: 0,
    constitution: '0',
    dexterity: '0'
}

class Hero extends React.Component() {
    constructor(props) {
        super(props);
        const str = this.props.strength;
        const constit = this.props.constitution;
        const dext = this.props.dexterity;
    }
    render() {
        return (
            <div>
                <p>Str = {str}</p>
                <p>Constitution = {constit}</p>
                <p>Dexterity={dext}</p>
            </div>
        );
    }
}

export default Hero;
